import './Notif.css'
function Notif({notifCound}){
    return(
        <>
    {notifCound > 0 &&(
        <a href="#" className="notifiction">
            <span>notifiction</span>
            <span className='badge'>{notifCound}</span>
        </a>
    )
}
</>
)

}
export default Notif
